export default class MenuPointing extends Component {
  state = { activeItem: 'Mypage' }

  handleItemClick = (e, { name }) => this.setState({ activeItem: name })

  render() {
    const { activeItem } = this.state

    return (
      <div class="navbar">

          <img src={Logo} alt='logo'width="120" height="50" />

      </div>
    )
  }
}
